function HomePage() {
  return (
    <div>
      <h1>Tigers</h1>
      <p>
        Tigers are the largest cat species in the world and are easily
        recognized by their distinctive orange fur with black stripes. They are
        native to Asia and can be found in a variety of habitats, including
        forests, grasslands, and swamps.
      </p>
      <p>
        Tigers are solitary animals and are known for their strength and
        agility. They are excellent swimmers and can even hunt in water. Tigers
        are carnivores and mainly feed on large ungulates such as deer, wild
        pigs, and buffalo.
      </p>
      <p>
        Sadly, all subspecies of tigers are endangered due to habitat loss and
        poaching. There are only about 3,900 wild tigers left in the world,
        making them one of the rarest and most beautiful animals on the planet.
      </p>
      <p>
        Efforts are being made to conserve and protect tigers, such as creating
        protected areas and increasing anti-poaching measures. With these
        efforts, it is hoped that wild tiger populations will be able to recover
        and thrive in the future.
      </p>
    </div>
  );
}


export default HomePage;
